import React, { Fragment } from "react";
import { Form, Input, Icon, Grid } from "semantic-ui-react";
import "./App.css";

function App() {
  return (
    <Fragment>
      <nav>
        <div className="logo">
          <h2>TodoList</h2>
        </div>
      </nav>
      <div className="bf">
        <Grid textAlign="center" >
          <Grid.Column style={{ maxWidth: '70vw' }} >
            <Form className="form"  size="large">
              <Form.Input  placeholder="Add Task" required/>
              <Form.Button  color="green" inverted >
                <Icon name="checkmark"/>Add Task
              </Form.Button>
            </Form>
          </Grid.Column>
        </Grid>

      </div>
    </Fragment>

    // <div>something</div>
  );
}

export default App;
